    backgroundColor: "black",
    padding: "3em",
    color: "#02FFFF",
    position: "absolute",
    width: "100%",
    bottom: "0"
}

const Footer = () => {
    return <footer >
        <a style={{ color: "black" }} href="https://icons8.com/icon/118501/facebook">Facebook icon by Icons8</a>
        <i className="material-icons" style={{ fontSize: '36px' }}>share</i>
    </footer>;
}


// #endregion

export default Footer;
